import React from 'react';
import CardList from './CardList';
import Searchbox from './SearchBox'
import {robotInfo} from './robot_info';

const App= ()=>
{
	return(
			<div>
					<h1>Robofriends</h1>
					<CardList robots_cardList={robotInfo}/>
					<Searchbox/>

			</div>
		)
}

export default App;
